import './styles.scss';

function Login() {
  return (
    <div className='page-login'>
      <div className='page-login-vf page-login-content'>
        <img src="/assets/library.png" alt="logo"/>

        <form className='page-login-vf page-login-form'>
          <div>
            <label>User: </label>
            <input className='page-login-user'/>
          </div>
          <div>
            <label>Password: </label>
            <input className='page-login-user'/>
          </div>
          <button type='submint'>Login</button>
        </form>
      </div>
    </div>
  );
}

export default Login;
